import React from 'react';
import './Main.css'

//components
import Section from './Section/Section';
import Blurb from './Blurbs/Blurb';


const Main = () => {
    return (
    <div className="container">

        <Section
        id='aboutme'>
            <Blurb title={'About Me'}/>
        </Section>
        
        <Section
        id='skills'>
        <Blurb title={'Skills'}/>
        </Section>

        <Section
        id='projects'>
        <Blurb title={'Projects'}/>
        </Section>

    </div>
    );
}

export default Main;
